import React from "react";
import Link from "next/link";
import NProgress from "nprogress";
import Router from "next/router";

Router.routeChangeStart = url => NProgress.start();
Router.routeChangeComplete = url => NProgress.done();
Router.routeChangeError = url => NProgress.done();

const Navbar = () => {
  return (
    <ul className="nav nav-tabs bg-primary">
      <li className="nav-item">
        <Link href="/">
          <a className="text-light nav-link">Home</a>
        </Link>
      </li>
      <li className="nav-item">
        <Link href="/login">
          <a className="text-light nav-link">Login</a>
        </Link>
      </li>
      <li className="nav-item">
        <Link href="/register">
          <a className="text-light nav-link">Register</a>
        </Link>
      </li>
    </ul>
  );
};

export default Navbar;
